  true,\n\t\"url\": null,\n\t\"notes\": \"Cloud-Aerosol Lidar and Infrared Pathfinder
  Satellite Observations (CALIPSO) was launched on April 28, 2006 to study the impact
  of clouds and aerosols on the Earthu2019s radiation budget and climate. It flies
  in formation with five other satellites in the international u201cA-Trainu201d (PDF)
  constellation for coincident Earth observations. The CALIPSO satellite comprises
  three instruments, the Cloud-Aerosol LIdar with Orthogonal Polarization (CALIOP),
  the Imaging Infrared Radiometer (IIR), and the Wide Field Camera (WFC). CALIPSO
  is a joint satellite mission between NASA and the French Agency, CNES. These data
  consist 5 km aerosol layer data.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
